import Vue from 'vue'
import VueRouter from 'vue-router'
import employeeLogin from '@/views/employeeLogin.vue'
Vue.use(VueRouter)

const routes = [
  { path: '/', redirect: '/employeeLogin' },
  { path: '/employeeLogin', component: employeeLogin }
]

const router = new VueRouter({
  routes
})

export default router
